-- Name: update_subscriptions_updated_at(); Type: FUNCTION; Schema: public; Owner: pnptvbot
--

CREATE FUNCTION public.update_subscriptions_updated_at() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    NEW.updated_at = NOW();
    RETURN NEW;
END;
$$;


