lanis Morissette", "description": "Gratitud por lo aprendido."}]	t	12	PNPtv		t	2026-01-04 10:29:00.511975	2026-01-04 10:29:00.511975
2	pnptv-system	Emotional Rollercoaster	A narrative journey through impulse, mental noise, intrusive thoughts, emotional numbness, breaking points, acceptance, and landing back in reality. Listen in order. Let each song do its work. It's not a party. It's a journey.	music		https://i.ytimg.com/vi/_9BGLtqqkVI/hqdefault.jpg	[{"url": "https://www.youtube.com/watch?v=_9BGLtqqkVI", "title": "1. Hash Pipe - Weezer", "description": "Impulso inicial: energa catica, decisiones rpidas, cero filtro. El momento donde todo arranca sin pensar demasiado.\\n\\n Why does it open the playlist? It captures the initial impulse: chaotic energy, fast decisions, no filter. The moment everything starts without overthinking."}, {"url": "https://www.youtube.com/watch?v=4D35vfQ7eZg", "title": "2. Come Undone - Robbie Williams", "description": "La euforia empieza a agrietarse. Sigue siendo intensa, pero ya convive con ansiedad y prdida de control.\\n\\n Why here? Euphoria starts to crack. It's still intense, but anxiety and loss of control begin to show."}, {"url": "https://www.youtube.com/watch?v=asaCQOZpqUQ", "title": "3. Don't Let Me Get Me - P!nk", "description": "Auto-conflicto. Frustracin. La mente girando contra s misma.\\n\\n What does it represent? Self-conflict. Frustration. The mind turning against itself."}, {"url": "https://www.youtube.com/watch?v=6TKYd-pHo1A", "title": "4. Berghain - Rosala feat. Bjrk & Yves Tumor", "description": "Pensamientos intrusivos: introspeccin intensa, dilogo interno invasivo, ideas que no se pueden apagar. Aqu el viaje se vuelve mental.\\n\\n Why is Berghain placed here? It represents intrusive thoughts: intense introspection, invasive inner dialogue, ideas you can't shut off. This is where the journey turns inward."}, {"url": "https://www.youtube.com/watch?v=yS8lkzNF-eU", "title": "5. Numb / Encore - Linkin Park & Jay-Z", "description": "Saturacin total. El ruido interno ya es constante y abrumador.\\n\\n Why next? Total saturation. The internal noise becomes constant and overwhelming."}, {"url": "https://www.youtube.com/watch?v=SYM-RJwSGQ8", "title": "6. Habits (Stay High) - Tove Lo", "description": "El intento de escapar. Repeticin emocional. Loop.\\n\\n What stage is this? The attempt to escape. Emotional repetition. A loop."}, {"url": "https://www.youtube.com/watch?v=8PtP3AO4Rgo", "title": "7. Novacane - Frank Ocean", "description": "Anestesia emocional. Nada duele pero nada se siente.\\n\\n Why here? Emotional numbness. Nothing hurts but nothing is felt either."}, {"url": "https://www.youtube.com/watch?v=tG21lp8fNpM", "title": "8. When It Hurts So Bad - Lauryn Hill", "description": "El quiebre. La emocin que ya no se puede evitar.\\n\\n What happens here? The break. Emotion you can no longer avoid."}, {"url": "https://www.youtube.com/watch?v=vuGL6RZg_Gs", "title": "9. Don't Leave Home - Dido", "description": "Aislamiento. Miedo. Necesidad de refugio.\\n\\n What does it represent? Isolation. Fear. The need for shelter."}, {"url": "https://www.youtube.com/watch?v=j-GqgTX43wo", "title": "10. Tears Dry on Their Own - Amy Winehouse", "description": "Aceptacin silenciosa. No todo se arregla, pero se sigue.\\n\\n Why before landing? Quiet acceptance. Not everything gets fixed, but you keep going."}, {"url": "https://www.youtube.com/watch?v=0MWlFi9d4c0", "title": "11. La Plata - Diomedes Daz", "description": "Aterrizaje terrenal. Memoria, culpa, realidad cotidiana.\\n\\n What does it bring? A grounded landing. Memory, consequence, everyday reality."}, {"url": "https://www.youtube.com/watch?v=JXRmZRmpsbE", "title": "12. Thank U - Alanis Morissette", "description": "No es felicidad forzada. Es conciencia. Gratitud por lo aprendido, incluso por lo incmodo.\\n\\n Why does it close the playlist? Not forced happiness. Awareness. Gratitude for the lessons  even the uncomfortable ones."}]	t	12	PNPtv		t	2026-01-05 00:55:11.494654	2026-01-05 00:55:11.494654
