--
-- Name: active_zoom_rooms _RETURN; Type: RULE; Schema: public; Owner: pnptvbot
--

CREATE OR REPLACE VIEW public.active_zoom_rooms AS
 SELECT r.id,
    r.room_code,
    r.zoom_meeting_id,
    r.zoom_meeting_password,
    r.host_user_id,
    r.host_email,
    r.host_name,
    r.host_auth_token,
    r.host_join_url,
    r.title,
    r.description,
    r.topic,
    r.scheduled_start_time,
    r.scheduled_duration,
    r.actual_start_time,
    r.actual_end_time,
    r.settings,
    r.is_public,
    r.requires_password,
    r.allowed_domains,
    r.status,
    r.is_active,
    r.total_participants,
    r.peak_participants,
    r.total_duration,
    r.recording_enabled,
    r.recording_status,
    r.recording_url,
    r.recording_file_size,
    r.telegram_group_id,
    r.shared_in_groups,
    r.created_at,
    r.updated_at,
    r.deleted_at,
    count(DISTINCT p.id) FILTER (WHERE (p.leave_time IS NULL)) AS current_participants,
    count(DISTINCT p.id) AS total_participants_ever
   FROM (public.zoom_rooms r
     LEFT JOIN public.zoom_participants p ON ((r.id = p.room_id)))
  WHERE (((r.status)::text = 'active'::text) AND (r.is_active = true))
  GROUP BY r.id;


--
-- Name: jitsi_room_statistics _RETURN; Type: RULE; Schema: public; Owner: pnptvbot
--

CREATE OR REPLACE VIEW public.jitsi_room_statistics AS
 SELECT r.id AS room_id,
    r.room_code,
    r.tier,
    r.title,
    r.host_user_id,
    r.status,
    r.current_participants,
    r.total_participants,
    r.peak_participants,
    r.total_duration,
    count(p.id) AS session_count,
    avg(p.duration) AS avg_session_duration
   FROM (public.jitsi_rooms r
     LEFT JOIN public.jitsi_participants p ON ((r.id = p.room_id)))
  GROUP BY r.id;


--
-- Name: zoom_room_statistics _RETURN; Type: RULE; Schema: public; Owner: pnptvbot
--

CREATE OR REPLACE VIEW public.zoom_room_statistics AS
 SELECT r.id AS room_id,
    r.room_code,
    r.title,
    r.host_user_id,
    r.status,
    count(DISTINCT p.id) AS total_participants,
    count(DISTINCT p.id) FILTER (WHERE (p.leave_time IS NULL)) AS current_participants,
    (avg((EXTRACT(epoch FROM (COALESCE((p.leave_time)::timestamp with time zone, CURRENT_TIMESTAMP) - (p.join_time)::timestamp with time zone)) / (60)::numeric)))::integer AS avg_duration_minutes,
    count(DISTINCT rec.id) AS total_recordings,
    count(DISTINCT e.id) AS total_events,
    count(DISTINCT m.id) AS total_messages,
    count(DISTINCT pl.id) AS total_polls
   FROM (((((public.zoom_rooms r
     LEFT JOIN public.zoom_participants p ON ((r.id = p.room_id)))
     LEFT JOIN public.zoom_recordings rec ON ((r.id = rec.room_id)))
     LEFT JOIN public.zoom_events e ON ((r.id = e.room_id)))
     LEFT JOIN public.zoom_chat_messages m ON ((r.id = m.room_id)))
     LEFT JOIN public.zoom_polls pl ON ((r.id = pl.room_id)))
  GROUP BY r.id;


